INSERT INTO `promo_mobil` (`id_promo`, `foto_promo`, `nama_event`, `desk`, `id_admin`) VALUES
(24, 'img/banner/be698a5cd90c525495457762bc51b3b4.webp', 'MERDEKA DEALS', 'Keluarga Wuling, Super Partner Program dari Wuling kembali hadir di bulan Agustus ini, melalui tema â€œMerdeka Dealsâ€ yang berlangsung di bulan Agustus 2021. Ajak kerabat atau teman Anda untuk membeli mobil Wuling selama promo ini berlangsung karena akan mendapatkan uang tunai senilai 4 juta rupiah* yang berlaku untuk costumer Super Partner Wuling.', 3),
(25, 'img/banner/b24c8b99eda6ec64f3e1d3c9c74f7b29.webp', 'Wuling Service Hemat', 'Keluarga Wuling, selama diberlakukannya PPKM (Pemberlakuan Pembatasan Kegiatan Masyarakat) di Indonesia yang sudah berlangsung sejak awal bulan Juli 2021 lalu, Wuling Motors Indonesia menghadirkan promo Wuling Service Hemat selama bulan Agustus 2021.\r\n\r\nPromo ini diberikan untuk Anda yang melakukan servis atau perawatan kendaraan di bengkel resmi Wuling sehingga tetap nyaman dan aman saat berkendara di masa pandemi COVID-19 ini. \r\n\r\nBerikut adalah penawaran promo Wuling Service Hemat:\r\n\r\nGratis 50 item pengecekan kendaraan sesuai standar Wuling*\r\nPilihan diskon, yaitu:\r\nPaket Hemat 1: diskon 20% oli mesin, gratis filter oli mesin, gratis gasket/seal oli mesin*\r\nPaket Hemat 2: diskon 10% suku cadang battery*\r\nPaket Hemat 3: diskon 10% suku cadang brake pad dan brake shoe*\r\nInformasi selengkapnya hubungi dan kunjungi dealer Wuling terdekat di kota Anda. \r\n\r\n*Syarat dan ketentuan berlaku', 3),
